"}",
"if (cc2[0].checked){",
"Score = Score + 1;",
"}",
"if (cc2[1].checked){",
"Score = Score + 2;",
"}",
"if (cc3[0].checked){",
"Score = Score + 1;",
"}",
"if (cc3[1].checked){",
"Score = Score + 2;",
"}",
"if (cc4[0].checked){",
"Score = Score + 1;",
"}",
"if (cc4[1].checked){",
"Score = Score + 2;",
"}",
"if (cc4[2].checked){",
"Score = Score + 3;",
"}",
"if (cc5[0].checked){",
"Score = Score + 1;",
"}",
"if (cc5[1].checked){",
"Score = Score + 2;",
"}",
"if (cc5[2].checked){",
"Score = Score + 3;",
"}",
"cctotal.value = Score;",
"}",
"}",
"",
