"    <div id=\"topicTitle\">",
"     Patient information: Corneal abrasion (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/corneal-abrasion-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H4976932\">",
"      <span class=\"h1\">",
"       What is a corneal abrasion?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A corneal abrasion is a scratch on the cornea. The cornea is the clear tissue that covers the colored part of your eye (",
"      <a class=\"graphic graphic_figure graphicRef70420 \" href=\"mobipreview.htm?28/27/29105\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4976947\">",
"      <span class=\"h1\">",
"       What causes a corneal abrasion?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A corneal abrasion can happen when something scratches your eye or gets stuck under your eyelid. Common things that can scratch a person&rsquo;s eye include fingernails, animal paws, branches, or pieces of paper. Tiny pieces of rust, wood, glass, plastic, or other objects that get stuck under your eyelid can also cause a corneal abrasion.",
"     </p>",
"     <p>",
"      You can also get a corneal abrasion from wearing contact lenses. This is more likely if you:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Wear contacts that don&rsquo;t fit well",
"       </li>",
"       <li>",
"        Wear contacts longer than you should, such as overnight",
"       </li>",
"       <li>",
"        Don&rsquo;t clean your contacts well",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4976962\">",
"      <span class=\"h1\">",
"       What are the symptoms of a corneal abrasion?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Common symptoms of a corneal abrasion are:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Feeling like you have a speck of sand in your eye",
"       </li>",
"       <li>",
"        Eye pain that is so bad you cannot work, drive, or sleep",
"       </li>",
"       <li>",
"        Teary, watery eyes",
"       </li>",
"       <li>",
"        Blurred vision",
"       </li>",
"       <li>",
"        Being very uncomfortable looking at bright lights",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4976977\">",
"      <span class=\"h1\">",
"       Is there anything I can do on my own to feel better?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you think you have something in your eye, you can try to remove it. But be careful not to irritate your eye. Do not rub or press on it. Blink a few times to see if you can remove anything that might be in your eye.",
"     </p>",
"     <p>",
"      You can also pull your upper eyelid over your lower eyelid to make your eye water (make tears) to wash away anything in your eye. If that doesn&rsquo;t work, rinse your eye with water once or twice. But rinsing more than a few times can make the problem worse.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4976992\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;See your doctor or nurse right away if you have the symptoms above and your eye still hurts a lot after you&rsquo;ve tried rinsing it.",
"     </p>",
"     <p>",
"      While waiting to see the doctor, your might feel better if you sit quietly in a darkened room with your eyes closed.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4977007\">",
"      <span class=\"h1\">",
"       Is there a test for a corneal abrasion?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor will do an eye exam. For the exam, the doctor will put a small drop of a special yellow dye in your eye. The dye will help the doctor see whether the cornea has been scratched. He or she will also flip up your upper eyelid to check if anything is stuck there.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4977022\">",
"      <span class=\"h1\">",
"       How is a corneal abrasion treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor can treat your corneal abrasion with eye ointments or drops. Some ointments and drops help prevent infections. Others help ease pain. The doctor might also give you pills to help with your pain.",
"     </p>",
"     <p>",
"      If the scratch on your cornea is large, the doctor might tape a gauze patch over your eye. This helps keep your eye closed, which helps it feel better. You should not use a fabric patch (&ldquo;pirate&rsquo;s patch&rdquo;) in place of gauze because it will not keep your eye closed. Most corneal abrasions heal in a few days.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4977037\">",
"      <span class=\"h1\">",
"       Can corneal abrasions be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;To lower your chances of getting a corneal abrasion, you can:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Wear safety goggles when you work with machines that cut wood, metal, or other materials",
"       </li>",
"       <li>",
"        Avoid wearing your contact lenses longer than directed",
"       </li>",
"       <li>",
"        Make sure your contact lenses fit well",
"       </li>",
"       <li>",
"        Keep your contact lenses clean",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H4977052\">",
"      <span class=\"h1\">",
"       More on this topic",
