var title_f42_9_43163="Empiric antibiotic therapy for mesh graft infections";
var content_f42_9_43163=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F52962&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F52962&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Empiric antibiotic therapy for mesh graft infections",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Options for empiric parenteral therapy:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Monotherapy with a beta-lactam/beta-lactamase inhibitor, such as one of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Ampicillin-sulbactam (3 g every six hours)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Piperacillin/tazobactam (4.5 g every eight hours)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Ticarcillin-clavulanate (3.1 g every four hours)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A third generation cephalosporin such as ceftriaxone (1 g every 24 hours)",
"        <strong>",
"         PLUS",
"        </strong>",
"        metronidazole (500 mg every eight hours)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A fluoroquinolone (eg, ciprofloxacin 400 mg every 12 hours or levofloxacin 500 mg daily)",
"        <strong>",
"         PLUS",
"        </strong>",
"        metronidazole (500 mg every eight hours)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Monotherapy with a carbapenem, such as one of the following:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Imipenem (500 mg every six hours)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Meropenem (1 g every&nbsp;eight hours)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Ertapenem (1 g daily)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Options for empiric oral therapy:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Amoxicillin-clavulanate (875/125 mg twice daily)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ciprofloxacin (500 mg twice daily)",
"        <strong>",
"         PLUS",
"        </strong>",
"        metronidazole (500 mg three times/day)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     <p>",
"      &nbsp;",
"     </p>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
