var title_f42_9_43164="Canada Guide heart dis kid tx 2";
var content_f42_9_43164=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F68334&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F68334&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Canadian Society of Transplantation consensus guidelines on eligibility for kidney transplantation, continued",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Cardiac disease, continued",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Recommendations, continued",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        7. Patients with IHD should be re-evaluated on a regular basis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Re-evaluation should include history, physical examination, ECG and non-invasive testing (Grade C)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Re-evaluation should occur any time a patient becomes symptomatic (Grade A)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Re-evaluation should occur annually in all patients who are at high risk (see previous recommendation for high-risk groups) (Grade C)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        A repeat angiogram may be considered in patients with known IHD before transplantation if waiting time has been prolonged and it is known that a transplant is likely within the next year (Grade C)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        All high-risk patients on the waiting list should be treated aggressively with risk-factor reduction strategies (Grade A)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        8. Left ventricular (LV) dysfunction is not necessarily a contraindication to kidney transplantation. LV function should be evaluated in all patients being assessed for transplantation with history, physical examination, ECG and chest radiography (Grade A). An echocardiogram should be performed in patients with evidence of LV dysfunction (Grade B) or in patients at high risk for LV dysfunction (patients with diabetes, CAD, longstanding hypertension, longstanding kidney disease or known valvular heart disease) (Grade C).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        9. Uremic LV dysfunction may improve after transplantation; thus it is not necessarily a contraindication to wait listing (Grade B).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        10. Patients with severe irreversible (non-uremic) cardiac dysfunction should not be listed for kidney transplantation alone. Selected patients may be candidates for combined heart-kidney transplants (Grade C).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        11. Children with evidence of cardiomyopathy on echocardiography or with congenital heart disease should be evaluated for transplantation in consultation with a pediatric cardiologist (Grade C).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        12. All patients should be monitored for aortic stenosis by history, physical examination and echocardiogram where clinical suspicion is high (Grade C).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        13. Patients with aortic stenosis should have regular follow-up echocardiograms, and consideration should be given to early surgical intervention as the disease is accelerated in renal failure (Grade C).",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * The strength of evidence supporting each recommendation was graded using the system developed by the Canadian Task Force on Preventive Health Care as follows:",
"     <br>",
"      Grade A - There is good evidence to support",
"      <br>",
"       Grade B - There is fair evidence to support",
"       <br>",
"        Grade C - The existing evidence is conflicting, but other factors may influence decision-making",
"        <br>",
"         Grade D - There is fair evidence to recommend against",
"         <br>",
"          Grade E - There is good evidence to recommend against",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Knoll, G, Cockfield, S, Blydt-Hansen, T, et al. Canadian Society of Transplantation: Consensus guidelines on eligibility for kidney transplantation. CMAJ 2005; 173:S1. Copyright &copy; 2005 CMA Media Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
